import React, { useState } from 'react';
import './styles.css';

function RewardCheckin() {
  const [rewardData, setRewardData] = useState({
    memberNumber: '',
    points: '',
    rewardAmount: '',
  });

  const handleCheckin = (e) => {
    e.preventDefault();
    // Handle the reward check-in logic here
  };

  return (
    <div className="reward-container">
      <h2>Reward Check-in</h2>
      <form onSubmit={handleCheckin}>
        <input
          type="text"
          name="memberNumber"
          placeholder="Member Number"
          value={rewardData.memberNumber}
          onChange={(e) =>
            setRewardData({ ...rewardData, memberNumber: e.target.value })
          }
          required
        />
        <input
          type="number"
          name="points"
          placeholder="Points"
          value={rewardData.points}
          onChange={(e) =>
            setRewardData({ ...rewardData, points: e.target.value })
          }
          required
        />
        <input
          type="number"
          name="rewardAmount"
          placeholder="Reward Amount"
          value={rewardData.rewardAmount}
          onChange={(e) =>
            setRewardData({ ...rewardData, rewardAmount: e.target.value })
          }
          required
        />
        <button type="submit">Check-in Reward</button>
      </form>
    </div>
  );
}

export default RewardCheckin;
